    max_power = 2
    for num in sequence:
        k = 1
        x = num
        while x % 2 == 0:
            k *= 2
            x //= 2
        max_power = max(max_power, k)
    count = sum((1 for num in sequence if num % max_power == 0))
    return (max_power, count)

